import React from 'react';
import ReactDOM from "react-dom/client";
import {
  BrowserRouter,
  Routes,
  Route,
    Link,
} from "react-router-dom";
const root = document.getElementById('root')
root.render(
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />}>
          <Route index element={<Home />} />
          <Route path="teams" element={<Teams />}>
          </Route>
        </Route>
      </Routes>
    </BrowserRouter>
);
function Home() {
    return (
        <div>
            <h1>Home</h1>
        </div>
    );
}
function App() {
    return (
        <div>
            <h1>App</h1>
        </div>
    );
}
function Teams() {
    return (
        <div>
            <h1>team</h1>
        </div>
    );
}
